const Div = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    text-align: center;
`

function Links(props) {
    return (
        <div>
            {props.text === props.tarifas && props.subtarifas.map((t, k) => <a>{t}</a>)}
        </div>)

}

export default Links;
